window.bookSummaryJSON = "<p><b>She thought she was too old for adventure… until it blew up her ship.</b></p> <p>Protecting her client while they cruised around the galaxy was easy work—at least until all hell broke loose. Now Loris is stuck on a hostile planet with poisonous flora, dangerous fauna, and a cocky-as-hell alien with big horns, broad shoulders, and an ego the size of a planet.</p> <p>She needs to do her job. He’s decided she needs <i>him</i>. The longer they’re together, the more she wonders if he might be right…or if she’s losing her mind as well as her heart.</p> <p><i>**Buckle up. This sci-fi romance contains an alien with fur, fangs, horns, and a very possessive attitude when it comes to the woman he’s claimed for his own.</i></p>"; 
